import React from 'react'
import {Container, Row, Col} from 'react-bootstrap';
import cpp from '../images/cpp.svg'
import esp32 from '../images/esp32.png'
import linux from '../images/linux.svg'
import npm from '../images/npm.svg'
import python from '../images/python.svg'
import react from '../images/react.svg'

const SkillsImages = () => {
    return(
        <div className='skillsimagesdiv'>
            <img  src={cpp} className='skillImage/>
            <img  src={esp32} className='skillImage/>
            <img  src={linux} className='skillImage/>
            <img  src={npm} className='skillImage/>
            <img  src={python} className='skillImage/>
            <img  src={react} className='skillImage/>

        </div>
    );
}

export default SkillsImages;
